import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Edit from "./Edit";
import Home from "./Home";


const App = () => {


  return (
    <div className="container">
      <div className="row">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/edit/:id" element={<Edit />} />
        </Routes>
      </BrowserRouter>
      </div>
    </div>
  );
};

export default App;
